text:
Independent Division of Xinjiang Military District (Chinese: 新疆军区独立师)(1st Formation) was formed in July 1966 from the Public Security Contingent of Xinjiang Uyghur Autonomous Region. The division was composed of three regiments (1st to 3rd). On February 25, 1969, the division exchanged its designation and position with Independent Division of Qinghai Provincial Military District with all its remaining 3 regiments, and became the second formation of Independent Division of Qinghai Military District (Chinese: 青海省军区独立师). All its regiments were renamed as follows: 
* 1st Regiment (former 2nd); 
* 3rd Regiment (former 3rd); 
* 7th Regiment (former 1st). As of October 26th 1970 the division was composed of 7 regiments. In May 1976 the division was disbanded.

The 9th Tank Division (Chinese: 坦克第9师) was formed on August 1, 1967 from 236th Tank Self-Propelled Artillery Regiment from 31st Army Division, 239th Tank Self-Propelled Artillery Regiment from 34th Army Division and 283rd Tank Self-Propelled Artillery Regiment from 179th Army Division. On August 28, 1969, the division was composed of: 
* 33rd Tank Regiment (former 236th Tank Self-Propelled Artillery Regiment); 
* 34th Tank Regiment (former 239th Tank Self-Propelled Artillery Regiment); 
* 35th Tank Regiment (former 283rd Tank Self-Propelled Artillery Regiment). The division moved to Changzhi, Shanxi province in November 1969 after its formation to reinforce 27th Army Corps. In the 1970s the division maintained as a reduced tank division, which consisted of 3 under-equipped tank regiments. In January 1976 the division was disbanded. Its 33rd Tank Regiment became Tank Regiment of 66th Army Corps, 34th Tank Regiment became Tank Regiment of 21st Army Corps and 35th Tank Regiment became Tank Regiment of 28th Army Corps.

